def relu(Z):
    return np.maximum(0,Z)

def single_layer_forward_propagation(A_prev, W_curr, b_curr):
    Z_curr = np.dot(W_curr, A_prev) + b_curr
    return Z_curr

def propogate(X):
    A_curr = X
    for i in range(1, 5):
        A_curr = relu(single_layer_forward_propagation(A_curr, weights['l{}.weight'.format(str(i))], weights['l{}.bias'.format(str(i))] )) 
    return A_curr


def predict(state):
    return (np.argmax(propogate(state)))
