def main():
    i = 0
    track = Track.read_from(argv[1])
    env = Environment(track)

    broken = False
    done = False

    while not broken and not done:
        i+=1
        action = predict(env.state())
        broken, done, progress = env.step(action)

    print(progress)

if __name__ == '__main__':
    main()
